@wrightsonwydown recap:

I have zero bad things to say about this place. You all know how much I love @louiedemun so I KNEW Wright’s would be amazing too. The service was incredible and I will forever sing the praises of all of the staff who helped us that night.

Every bite I had made me exclaim out loud because it was all that good. The juicy burger, the crab cake, and shrimp scampi were among my faves but you can’t go wrong with any dish, including the giant sundae for dessert!

Reservations are hard to come by, but they release new reservations at midnight on the first of each month (for the following month) if you want to stay up to snag one. OR you can be lucky enough like I was last month to stumble onto their reservation site and realize they had a 5:30pm slot open that day and text your husband that he needs to drop everything and meet you there after work because you’re excited to finally go 😂

@wrightsonwydown is not to be missed for so so so many reasons. 🫶🏼

